measurements.description:
Two flowers and two buds on two up to 24-cm inflorescences;
 sepals cream overlaid light chartreuse, spotted and striped mahogany, dorsal sepal spotted, coalescing to heavier stripe centrally;
 petals chartreuse, lightly ruffled on upper margin, superior half overlaid mahogany, stippled mahogany basally; 
 pouch chartreuse overlaid light brown; staminode chartreuse, stippled brown sides; substance medium; texture waxy.
